import "../styles/restrictions.css"

function Restriction({title, text}) {
    return (
        <div className="restriction-container">
            <div className="restriction-title">
                {title}
            </div>
            <div className="restriction-text">
                {text}
            </div>
        </div>
    )
}

export default Restriction
